contract Auction {
    address public auctioneer; // the address of the auctioneer
    mapping(address => uint256) public bids; // mapping of bidders and their bids
    uint256 public startTime; // the time the auction starts
    uint256 public endTime; // the time the auction ends
    uint256 public highestBid; // the highest bid amount
    address public highestBidder; // the address of the highest bidder

    constructor(uint256 _startTime, uint256 _endTime) {
        auctioneer = msg.sender;
        startTime = _startTime;
        endTime = _endTime;
    }

    function placeBid() public payable {
        // require(block.timestamp >= startTime && block.timestamp <= endTime, "Auction is not running");
        require(msg.value > highestBid, "Bid amount is too low");
        
        if (highestBidder != address(0)) {
            // refund previous highest bidder
            payable(highestBidder).transfer(highestBid);
        }
        
        highestBid = msg.value;
        highestBidder = msg.sender;
        bids[msg.sender] = msg.value;
    }

    function withdrawBid() public {
        require(block.timestamp < startTime, "Auction has started");
        require(msg.sender != highestBidder, "You are the highest bidder");
        
        uint256 amount = bids[msg.sender];
        bids[msg.sender] = 0;
        payable(msg.sender).transfer(amount);
    }

    function endAuction() public {
        require(block.timestamp > endTime, "Auction is still running");
        require(msg.sender == auctioneer, "Only the auctioneer can end the auction");
        
        payable(auctioneer).transfer(highestBid);
    }
}

